import React from 'react';

function ResultTable({ results }) {
    // Ensure results and results.path are valid
    if (!results || !results.path) {
        return <p>No route data available. Please calculate a route.</p>;
    }

    return (
        <div className="result-table">
            <h2>Route Results</h2>
            <table>
                <thead>
                    <tr>
                        <th>Route</th>
                        <th>Distance (miles)</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        {/* Safely render the path and distance */}
                        <td>{results.path.join(' -> ')}</td>
                        <td>{results.distance.toFixed(2)}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default ResultTable;
